import "../stylesheets/nav.css";
import NavBar from "./nav/NavBar";

const Nav = () => {
  return (
    <nav>
      <div className="topnav" id="myTopnav">
        <div className="logo to-left">
          <div class="logo-line">flomi</div>
          <div class="logo-line">--innovating your tomorrow, today--</div>
          <div class="logo-line">tech</div>
        </div>
        <NavBar />
        <div className="clear"></div>
      </div>
    </nav>
  );
};

export default Nav;
